import React from "react";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js";
import { Pie } from "react-chartjs-2";
import datalabels from "chartjs-plugin-datalabels";

ChartJS.register(ArcElement, Tooltip, Legend, datalabels);

export default function Admincircledprogress() {
  return (
    <>
      <div className="admincircledprogress"></div>
    </>
  );
}

function Admincircle() {
  const options = {
    responsive: true,
    // maintainAspectRatio: true,
    plugins: {
      legend: {
        position: "top",
        display: false,
      },
      // labels:{
      //   render: 'percentage',
      //   fontColor: ['#8833FF','F4F1FC'],
      //   precision: 2

      // }
    },
  };

  const data = {
    labels: ["Red", "Blue"],
    datasets: [
      {
        label: "# of Votes",
        data: [24, 76],
        backgroundColor: ["#F4F1FC", "#F4F1FC"],
        borderColor: ["#EADFFC", "#8833FF"],
        borderWidth: 2,
      },
    ],
  };

  return (
    <>
      <div style={{ maxWidth: "240px" }}>
        <Pie options={options} data={data} />
      </div>
    </>
  );
}
